import React from 'react';
import DebugLogin from '../components/auth/DebugLogin';


const LoginPage = () => {
  return (
    <div style={{ 
      minHeight: '100vh', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center',
      backgroundColor: '#f5f5f5'
    }}>
      <DebugLogin />
    </div>
  );
};

export default LoginPage;
